// src/components/BikeCard.js
import React from 'react';
import '../styles/bikeCard.css';



const BikeCard = ({ bike }) => {
  return (
    <div className="bike-card">
      <img src={bike.img_url} alt={bike.model} className="bike-image" />
      <h2>{bike.manufacturer} {bike.model}</h2>
      <p>Category: {bike.category}</p>
      <p>Price: {bike.price}</p>
      <p>Colour: {bike.colour}</p>
      <p>Weight: {bike.weight}</p>
    </div>
  );
};

export default BikeCard;
